Государственное учреждение Самарской области «Туристическо-оздоровительный комплекс» предлагает Вашему вниманию возможность проведения незабываемого отдыха в живописном уголке Жигулевских гор на берегу Куйбышевского водохранилища (на базе туристическо-оздоровительного комплекса «Здоровяк–Звездный»). Расстояние от г. Самара составляет 130 км.
К услугам отдыхающих будут предложены: 
– территория базы общей площадью более 10 Га со всеми необходимыми спортивными сооружениями и площадками (волейбол, футбол, баскетбол, бадминтон, настольный теннис, тренажерный зал);
– VIP-коттедж и гостиничный корпус повышенной комфортности класса LUX (со всеми удобствами, мебелью и бытовой техникой);
– два трехэтажный спальных корпуса и летние деревянные щитовые домики эконом класса;
– культурно-развлекательный центр с бильярдом, кинозалом, мощной акустической системой и полностью оборудованной сценой;
– новая современная столовая с обеденным залом на 140 мест, где будет организовано питание с учетом Ваших пожеланий Просторный зал рассчитан также и для проведения свадеб, банкетов, юбилеев, завтрак входит в стоимость проживания в гостиничном корпусе. Также возможно разделение на завтрак/обед/ужин;
– подготовлена насыщенная экскурсионная программа, позволяющая отдыхающим познакомиться с удивительной красотой окружающей природы и получить незабываемые впечатления от посещения уникальных мест! Прогулки на велосипедах, катамаранах, снегоходе (в зимнее время), экскурсия к святому источнику в селе Большая Рязань, посещение Усинского кургана, встреча рассвета на вершине Молодецкого кургана, поездка к памятнику природы "Каменная чаша" –  все это доставит Вам массу удовольствия;
– для детей на территории комплекса построена детская игровая площадка с горками и качелями;
Для получения подробной информации Вы можете посетить наш сайт в сети Интернет по адресу: www.gusotok.samregion.ru или обратиться непосредственно в офис, расположенный по адресу: г. Самара, ул. Скляренко, 20, оф. 500, т. (846) 334-11-87.
